import React from "react";

const LeftBlock = () => {
  return (
    <div>
      <div>
        <h3>Welcome to Shape Calculator</h3>
      </div>
      <div>
        <p>
          Shape Calculator is an interactive web application. To the right you
          will find the 3 step application. Follow the intstructions in each
          step . Clicking cancel will take you back to step 1. Enjoy!
        </p>
      </div>
    </div>
  );
};

export default LeftBlock;
